import React from 'react';

class Screen extends React.Component {
    render() {
        return (
            <div className="screen">
                <input type="text" value={this.state.value} onchange={this.handleScreenChange} disabled>{this.props.screenValue}</input>
            </div>
        )
    }
}

export default Screen;
